There are two artists sharing the name Naut: 1) a British post-punk band (which is currently active); 2) a Danish pop band (which has now split up);

1) Naut are a post-punk band from Bristol. Their debut EP 'Raise the Lights' is due out in Spring 2018.

2) Naut was a danish band, primarily consisting of frontman Rasmus Olsen. They released their debut album "Traffic Island" in 2005. It was a solid pop record, but didn't get much attention. <a href="https://www.last.fm/music/Naut">Read more on Last.fm</a>

